export default (state = [], action) => {
	switch(action.type) {
		case 'FETCH_CHANNEL':
			return {...state, [action.payload.id]: action.payload};
		case 'FETCH_CHANNELS':
			return action.payload;
		case 'CREATE_CHANNEL':
			return {...state, [action.payload.id]: action.payload};
		default:
			return state;
	}
};
